import React from "react";

function MainCont() {
  return (
    <section className="main__cont">
      <div className="main__inner">
        <div>we provide</div>
        <div>visual coding</div>
        <div>solutions</div>
        <div>for you webs</div>
      </div>
    </section>
  );
}

export default MainCont;
